Note that wasm-bindgen also aims to compile on all targets. This means that it should be safe, if you like, to use #[wasm_bindgen] even when compiling for Windows (for example). For example: #[wasm_bindgen]
pub fn add(a: u32, b: u32) -> u32 { a + b
} #[cfg(not(target_arch = "wasm32"))]
fn main() { println!("1 + 2 = {}", add(1, 2));
} This program will compile and work on all platforms, not just wasm32-unknown-unknown. Note that imported functions with #[wasm_bindgen] will unconditionally panic on non-wasm targets. For example: #[wasm_bindgen]
extern "C" { #[wasm_bindgen(js_namespace = console)] fn log(s: &str);
} fn main() { log("hello!");
} This program will unconditionally panic on all platforms other than wasm32-unknown-unknown. For better compile times, however, you likely want to only use #[wasm_bindgen] on the wasm32-unknown-unknown target. You can have a target-specific dependency like so: [target.'cfg(target_arch = "wasm32")'.dependencies]
wasm-bindgen = "0.2" And in your code you can use: #[cfg(target_arch = "wasm32")]
#[wasm_bindgen]
pub fn only_on_the_wasm_target() { // ...
}

144.body:
WebAssembly recently has gained support for a new value type called externref. Proposed in the WebAssembly reference types repo this feature of WebAssembly is hoped to enable more efficient communication between the host (JS) and the Wasm module. This feature removes the need for much of the JS glue generated by wasm-bindgen because it can natively call APIs with JS values. For example, this Rust function: #[wasm_bindgen]
pub fn takes_js_value(a: &JsValue) { // ...
} generates this JS glue without reference types support: const heap = new Array(32).fill(undefined); heap.push(undefined, null, true, false); let stack_pointer = 32; function addBorrowedObject(obj) { if (stack_pointer == 1) throw new Error('out of js stack'); heap[--stack_pointer] = obj; return stack_pointer;
} export function takes_js_value(a) { try { wasm.takes_js_value(addBorrowedObject(a)); } finally { heap[stack_pointer++] = undefined; }
} We can see here how under the hood the JS is managing a table of JS values which are passed to the Wasm binary, so Wasm actually only works in indices. If we compile with -Ctarget-feature=+reference-types (by default since Rust v1.82), however, the generated JS looks like: export function takes_js_value(a) { wasm.takes_js_value(a);
} And that's it! The WebAssembly binary takes the JS value directly and manages it internally. Currently this feature is supported in Firefox 79+ and Chrome. Support in other browsers is likely coming soon! In Node.js this feature is behind the --experimental-wasm-anyref flag, although the support does not currently align with the upstream specification as of 14.6.0.

