Often when developing a crate you want to run on the web you'll want to include some JS code here and there. While js-sys and web-sys cover many needs they don't cover everything, so wasm-bindgen supports the ability to write JS code next to your Rust code and have it included in the final output artifact. To include a local JS file, you'll use the #[wasm_bindgen(module)] macro: #[wasm_bindgen(module = "/js/foo.js")]
extern "C" { fn add(a: u32, b: u32) -> u32;
} This declaration indicates that all the functions contained in the extern block are imported from the file /js/foo.js, where the root is relative to the crate root (where Cargo.toml is located). The /js/foo.js file will make its way to the final output when wasm-bindgen executes, so you can use the module annotation in a library without having to worry users of your library! The JS file itself must be written with ES module syntax: export function add(a, b) { return a + b;
} A full design of this feature can be found in RFC 6 as well if you're interested!

