JavaScript modules will often export arbitrary static objects for use with their provided interfaces. These objects can be accessed from Rust by declaring a named static in the extern block with an #[wasm_bindgen(thread_local_v2)] attribute. wasm-bindgen will bind a JsThreadLocal for these objects, which can be cloned into a JsValue. These values are cached in a thread-local and are meant to bind static values or objects only. For getters which can change their return value or throw see how to import getters . For example, given the following JavaScript: let COLORS = { red: 'rgb(255, 0, 0)', green: 'rgb(0, 255, 0)', blue: 'rgb(0, 0, 255)',
}; static can aid in the access of this object from Rust: #[wasm_bindgen]
