} fn get_colors() -> JsValue { COLORS.with(JsValue::clone)
} Since COLORS is effectively a JavaScript namespace, we can use the same mechanism to refer directly to namespaces exported from JavaScript modules, and even to exported classes: let namespace = { // Members of namespace...
