Many APIs on the web work with a Promise, such as an async function in JS. Naturally you'll probably want to interoperate with them from Rust! To do that you can use the wasm-bindgen-futures crate as well as Rust async functions. The first thing you might encounter is the need for working with a Promise. For this you'll want to use js_sys::Promise . Once you've got one of those values you can convert that value to wasm_bindgen_futures::JsFuture. This type implements the std::future::Future trait which allows naturally using it in an async function. For example: async fn get_from_js() -> Result<JsValue, JsValue> { let promise = js_sys::Promise::resolve(&42.into()); let result = wasm_bindgen_futures::JsFuture::from(promise).await?; Ok(result)
} Here we can see how converting a Promise to Rust creates a impl Future<Output = Result<JsValue, JsValue>>. This corresponds to then and catch in JS where a successful promise becomes Ok and an erroneous promise becomes Err. You can also import a JS async function directly with a extern "C" block, and the promise will be converted to a future automatically. For now the return type must be JsValue or no return at all: #[wasm_bindgen]
extern "C" { async fn async_func_1_ret_number() -> JsValue; async fn async_func_2();
} async fn get_from_js() -> f64 { async_func_1_ret_number().await.as_f64().unwrap_or(0.0)
} The async can be combined with the catch attribute to manage errors from the JS promise: #[wasm_bindgen]
extern "C" { #[wasm_bindgen(catch)] async fn async_func_3() -> Result<JsValue, JsValue>; #[wasm_bindgen(catch)] async fn async_func_4() -> Result<(), JsValue>;
} Next up you'll probably want to export a Rust function to JS that returns a promise. To do this you can use an async function and #[wasm_bindgen]: #[wasm_bindgen]
pub async fn foo() { // ...
} When invoked from JS the foo function here will return a Promise, so you can import this as: import { foo } from "my-module"; async function shim() { const result = await foo(); // ...
}

